import React from "react";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import AppBar from "@material-ui/core/AppBar/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import IconButton from "@material-ui/core/IconButton";
import DashboardIcon from "@material-ui/icons/Dashboard";

const DashboardCard = (props) => {

    return (
        <Card>
            <AppBar position="static">
                <Toolbar>
                    <IconButton edge="start" color="inherit" aria-label="menu">
                        <DashboardIcon/>
                    </IconButton>
                    <Typography variant="h6">
                        Nasa
                    </Typography>
                </Toolbar>
            </AppBar>
            {/*<div style={{textAlign: "center", marginLeft: "15px", marginRight: "15px", marginTop: "15px"}}>*/}
            {/*    {data === undefined ? <h4>{"Couldn't load image."}</h4> : <Image src={data.url} fluid/>}*/}
            {/*    <p style={{marginTop: "15px"}}>{data === undefined ? "Couldn't load title." : data.title}</p>*/}
            {/*</div>*/}
            <CardMedia
                image="/static/images/cards/contemplative-reptile.jpg"
                title="Nasa's picture of the day"
            />
            <CardContent>
                <Typography color="textSecondary" gutterBottom>
                    Picture of the Day
                </Typography>
                <Typography variant="body2" component="p">
                    Nasa's picture of the day.
                </Typography>
            </CardContent>
        </Card>
    );
};

export default DashboardCard;
